import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'
import Avatar from '@material-ui/core/Avatar'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}))

const particleOpt = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: false,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    const classes = useStyles()
    return (
      <div className={classes.root}>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Grid className="wrapper" direction="column" item lg={12} container>
          <Grid item lg={2} direction="column"></Grid>
          <Grid className="introduction" direction="column" item lg={8}>
            <Grid item lg={12}>
              <Grid item lg={3}>
                <Avatar alt="Profile Picture" size="large" src="/img/maicon.png" />
              </Grid>
              <Grid item lg={9} className="hello" component="hgroup">
                <h1 align="center">Hello, I'm <span>Maicon Esteves</span></h1>
                <h2 align="center">I'm a full-stack developer</h2>
              </Grid>
              <Button className="bt-index" variant="outlined" size="large" color="secondary" href="home">Default</Button>
            </Grid>
          </Grid>
          <Grid item lg={2}></Grid>
        </Grid>
      </div>
    )
}

export default Index
